import { useState } from 'react';


export default function Index(props) {

   const [title, setTitle] = useState("")
   const newLists = props.lists

  return (
    <div>
      <form>
        <input 
          value={title} 
          placeholder='List title'
          onChange={e => setTitle(e.target.value)}
          type='text'
          name='title'
          required
        > 
        </input>
        <button onClick={() => {
          setTitle("")
          props.setLists(newLists)
        }}>
          Click me
        </button>
      </form>
    </div>
  );
}
